import React from 'react'
import DeleteSongButton from './deleteSongButton'
import { useSongs, useGigInfo } from './util/hooks'

const Songs = () => {
  const { songs } = useSongs()
  const { gigInfo } = useGigInfo()

  if (!songs) {
    return (
      <div>
        <p>no songs</p>
      </div>
    )
  }

  return (
    <div>
      <p>there are songs</p>
    </div>
  )
}

export default Songs
